#include <stdio.h>
int main() {
    int p = 18, q = 24;
    if(p % 6 == 0)
        if(q % 6 == 0)
            printf("%d", p / 6 + q / 6);
        else
            printf("%d", p / 6);
    else if(q % 6 == 0)
        printf("%d", q / 6);
    else
        printf("%d", 0);
