#include <stdio.h>
int main() {
    int ans = 0;
    for(int i = 1; i <= 4; i++) {
        for(int j = 4; j >= 1; j--) {
            if(i == j)
                break;
            if(i > j)
                continue;
            ans += i * j;
        }
    }
    printf("%d", ans);
    return 0;
}

