#include <stdio.h>
int main() {
    int month = 6;
    switch(month) {
        case 12: case 1: case 2:
            printf("Winter"); break;
        case 3: case 4: case 5:
            printf("Spring"); break;
        case 6: case 7: case 8:
            printf("Summer"); break;
        default:
            printf("Fall");
    }
    return 0;
}

