#include <stdio.h>
int findMax(int arr[], int size) {
    int max = arr[0];
    for(int i = 1; i < size; i++) {
        if(arr[i] > max)
            max = arr[i];
    }
    return max;
}
int main() {
    int data[] = {12, 45, 23, 67, 34};
    printf("%d", findMax(data, 5));
    return 0;
}

