#include <stdio.h>
int main() {
    int box[2][3] = {{5, 10, 15}, {20, 25, 30}};
    int ans = 0;
    for(int i = 0; i < 2; i++) {
        for(int j = 0; j < 3; j++) {
            if(i == 0 || j == 2)
                ans += box[i][j];
        }
    }
    printf("%d", ans);
    return 0;
}
